import React from 'react';
import PrototypeDemo from './PrototypeDemo';

function App() {
  return (
    <div className="App" style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Prototype Pattern Demo</h1>
      <PrototypeDemo />
    </div>
  );
}

export default App;
